import React, { useState } from 'react';
import { Container, Typography, Button, Grid, Select, MenuItem, FormControl, InputLabel, AppBar, Toolbar, IconButton, Drawer, List, ListItem, ListItemText, Radio, RadioGroup, FormControlLabel, Alert } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom';
import BackgroundImage from '../../assets/background.jpg';

const LandingPage: React.FC = () => {
  const [ageRange, setAgeRange] = useState('');
  const [bodyType, setBodyType] = useState('');
  const [gender, setGender] = useState('male');
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');
  const navigate = useNavigate();

  const handleStart = () => {
    if (!gender || !ageRange || !bodyType) {
      setErrorMessage('Please select your gender, age range, and body type to continue.');
      return;
    }
    setErrorMessage(''); // Clear error message if all fields are filled
    navigate('/login');
  };

  const toggleDrawer = (open: boolean) => {
    setDrawerOpen(open);
  };

  const handleMenuClick = (route: string) => {
    navigate(route);
    setDrawerOpen(false);
  };

  const gridBackgroundColor = 'rgba(192, 192, 192, 0.8)'; // Couleur de fond pour les Grid et le Drawer

  return (
    <div style={{ 
      height: '100vh', 
      backgroundImage: `url(${BackgroundImage})`, 
      backgroundSize: 'cover', 
      backgroundRepeat: 'no-repeat', 
      backgroundPosition: 'center', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      flexDirection: 'column'
    }}>
      <AppBar position="fixed" sx={{ backgroundColor: 'transparent', boxShadow: 'none' }}>
        <Toolbar>
          <IconButton 
            edge="start" 
            color="inherit" 
            aria-label="menu" 
            onClick={() => toggleDrawer(true)}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Fitness Tracker
          </Typography>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => toggleDrawer(false)}
        PaperProps={{
          sx: {
            backgroundColor: gridBackgroundColor, // Applique la couleur de fond sur tout le Drawer
            color: '#000', // Texte en noir pour un meilleur contraste
          }
        }}
      >
        <List>
          <ListItem button onClick={() => handleMenuClick('/workout')}>
            <ListItemText primary="Workouts" />
          </ListItem>
          <ListItem button onClick={() => handleMenuClick('/nutrition')}>
            <ListItemText primary="Nutrition" />
          </ListItem>
          <ListItem button onClick={() => handleMenuClick('/goals')}>
            <ListItemText primary="Goals" />
          </ListItem>
          <ListItem button onClick={() => handleMenuClick('/meal-ideas')}>
            <ListItemText primary="Meal Ideas" />
          </ListItem>
        </List>
      </Drawer>

      <Container 
        sx={{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#fff',
          padding: '20px',
          backgroundColor: 'rgba(0, 0, 0, 0.6)', // Une légère opacité pour le conteneur
          borderRadius: '10px',
          marginTop: '100px', // Ajoute un espace sous le Navbar
        }}
      >
        <Typography variant="h4" gutterBottom>
          Welcome to Fitness Tracker
        </Typography>
        <Typography variant="h6" gutterBottom>
          Please choose your gender, age range, and body type
        </Typography>

        {errorMessage && (
          <Alert severity="error" sx={{ marginBottom: '20px' }}>
            {errorMessage}
          </Alert>
        )}

        <FormControl component="fieldset" sx={{ marginBottom: '20px' }}>
          <RadioGroup
            row
            aria-label="gender"
            name="gender"
            value={gender}
            onChange={(e) => setGender(e.target.value)}
          >
            <FormControlLabel value="male" control={<Radio />} label="Male" />
            <FormControlLabel value="female" control={<Radio />} label="Female" />
          </RadioGroup>
        </FormControl>

        <Grid container spacing={3}>
          <Grid item xs={12} sm={6}>
            <FormControl fullWidth variant="outlined" sx={{ backgroundColor: gridBackgroundColor, borderRadius: '10px', padding: '0px' }}>
              <InputLabel>Age group</InputLabel>
              <Select
                value={ageRange}
                onChange={(e) => setAgeRange(e.target.value as string)}
                label="Tranche d'âge"
              >
                <MenuItem value="18-25">18-25</MenuItem>
                <MenuItem value="26-35">26-35</MenuItem>
                <MenuItem value="36-45">36-45</MenuItem>
                <MenuItem value="46+">46+</MenuItem>
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} sm={6}>
            <FormControl fullWidth variant="outlined" sx={{ backgroundColor: gridBackgroundColor, borderRadius: '10px', padding: '0px' }}>
              <InputLabel>Body type</InputLabel>
              <Select
                value={bodyType}
                onChange={(e) => setBodyType(e.target.value as string)}
                label="Type de corps"
              >
                <MenuItem value="ectomorph">Ectomorphe</MenuItem>
                <MenuItem value="mesomorph">Mésomorphe</MenuItem>
                <MenuItem value="endomorph">Endomorphe</MenuItem>
              </Select>
            </FormControl>
          </Grid>
        </Grid>

        <Button 
          variant="contained" 
          sx={{ marginTop: '30px', backgroundColor: '#FF9800', color: '#fff', '&:hover': { backgroundColor: '#e68900' } }}
          onClick={handleStart}
        >
          <b>Let's start</b>
        </Button>
      </Container>
    </div>
  );
};

export default LandingPage;
